import React from 'react'

class Footer extends React.Component {

    render() {
        return (
            <footer class='bg-dark white-text' style={{width: "100%"}}>
                <div class='row'>
                    <div class='col'>
                        <p class='navbar-brand'>info info info</p>
                    </div>
                    <div class='col'>
                        <p class='navbar-brand'>info info info</p>
                    </div>
                </div>
            </footer>
        )
    }
}

export default Footer;
